import React from 'react'

const TodoList = ({ list, toggleTodo }) => {
    return (
      <div className="todo-list-container">
        {list.map((todo) => (
          <TodoItem item={todo} key={todo.id} toggleTodo={toggleTodo} />
        ))}
      </div>
    );
  };

export default TableList
